import React from "react";

import ERP from "../../UI/Img/erp_development.png";
import WEB from "../../UI/Img/web_application-2.png";
import DESIGN from "../../UI/Img/DESIGN";

const WhatWeDo = () =>{
    return(
<div>
    <h1>What We DO</h1>
    <div>
        <img src={ERP} alt="erp"/>
        <img src={WEB} alt="web"/>
        <img src={DESIGN} alt="design"/>
        <img/>
    </div>
</div>
    );
}

export default WhatWeDo;
